import React, {Component} from "react";

class Message extends Component {

    constructor () {    
        super()
        this.state = {
                message: ''

            }
    }

    changeMessage () {
        this.setState({
            message: 'Thank you ',
            message2: 'for subcribing'
        })
    }

    goBack() {
        this.setState({
            message2: '',
            message: 'Bye Bye !'
        })
    }

    render() {
        return (
            <div>
                <h1> { this.state.message } {this.state.message2} </h1>
                <button onClick={() => this.changeMessage()}> subcribe</button>
                <button onClick={() => this.goBack()}> unsubcribe</button>
            </div>
        )
    }
}

export default Message
